import style from './SearchBar.module.css';
import { useState } from 'react';

export default function SearchBar(props) {
    console.log(props.name)
    return (
       <div>
          <input type='search' />
          <button onClick={() => props.onSearch(props.characterID)}>Agregar</button>
       </div>
    );
 }
